            if (options.repositionResizeMarkers) {
                this._nwMarker.setLatLng(this._nw);
                this._neMarker.setLatLng(this._ne);
                this._swMarker.setLatLng(this._sw);
                this._seMarker.setLatLng(this._se);
            }

